      "created_at" : "Sun Nov 04 16:05:19 +0000 2012",
      "favorited" : false,
      "full_text" : "Cloud Atlas implies that the current mood in America is that we're looking for individual moral codes of conduct without standing for it.",
      "lang" : "en"
